import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();
  return (
    <div className="font-inter text-white">
      <section className="py-12 md:py-20 px-4 max-w-4xl mx-auto">
        <div className="mb-8 text-center">
          <h1 className="text-4xl md:text-5xl font-extrabold bg-gradient-to-r from-green-400 via-lime-300 to-emerald-500 bg-clip-text text-transparent mb-4 drop-shadow-lg">AgriGuru: AI-Powered Farming Assistant</h1>
          <p className="text-lg md:text-xl text-green-100 max-w-2xl mx-auto mb-6 font-medium">
            Revolutionizing Indian agriculture with the power of artificial intelligence and satellite technology. AgriGuru empowers farmers, agronomists, and enthusiasts with actionable insights, crop recommendations, real-time weather, government schemes, and more—all in a single, beautifully designed platform.
          </p>
          <p className="text-green-200 max-w-3xl mx-auto mb-4 text-base md:text-lg">
            <b>Why AgriGuru?</b> <br />
            Agriculture is the backbone of India, yet millions of farmers struggle with unpredictable weather, poor crop planning, and limited access to expert advice. We built AgriGuru to bridge this gap—combining AI, data, and user-friendly design to deliver personalized, reliable, and actionable information at every step of the farming journey. Our vision is to enable every farmer to make smarter decisions, boost productivity, and embrace sustainable, organic practices for a greener tomorrow.
          </p>
          <p className="text-green-200 max-w-3xl mx-auto mb-4 text-base md:text-lg">
            <b>Our Mission:</b> <br />
            To democratize access to advanced agri-tech, empower rural communities, and create a thriving ecosystem where technology and tradition work hand-in-hand. With AgriGuru, you get the best of AI recommendations, satellite insights, government support, and expert tips—right at your fingertips.
          </p>
          <button
            onClick={() => document.getElementById('features-section').scrollIntoView({ behavior: 'smooth' })}
            className="mt-8 bg-gradient-to-r from-green-500 to-emerald-400 hover:from-green-600 hover:to-emerald-600 text-white font-bold py-3 px-8 rounded-full shadow-lg text-xl transition-all duration-200"
          >
            Explore Features ↓
          </button>
        </div>
      </section>
      <section id="features-section" className="py-10 px-2 max-w-5xl mx-auto">
        <h2 className="text-3xl md:text-4xl font-bold text-green-200 mb-8 text-center drop-shadow">Key Features</h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 gap-8">
          {[
            { icon: '🌱', title: 'Crop Recommendation', desc: 'Get AI-powered suggestions for the best crops to grow based on your soil, season, and location.' },
            { icon: '⛅', title: 'Weather Forecast', desc: 'Access real-time and 5-day weather forecasts tailored to your farm location.' },
            { icon: '🛰️', title: 'Satellite Insights', desc: 'Visualize NDVI, soil moisture, and cloud cover using OpenWeather satellite data.' },
            { icon: '🍃', title: 'Organic Tips', desc: 'Receive expert advice and ask questions about organic and sustainable farming.' },
            { icon: '🏛️', title: 'Government Schemes', desc: 'Explore the latest government schemes and benefits for farmers in your state.' },
            { icon: '📊', title: 'Dashboard', desc: 'Track your queries, recommendations, and farming activities in one place.' },
            { icon: '🤖', title: 'AI Chatbot', desc: 'Chat with an AI assistant for instant answers to your farming queries.' },
          ].map((f, i) => {
            const isDark = i % 2 === 0;
            return (
              <a
                key={f.title}
                href={
                  f.title === 'Crop Recommendation' ? '/crop-recommendation' :
                  f.title === 'Weather Forecast' ? '/weather' :
                  f.title === 'Satellite Insights' ? '/satellite' :
                  f.title === 'Organic Tips' ? '/tips' :
                  f.title === 'Government Schemes' ? '/schemes' :
                  f.title === 'Dashboard' ? '/dashboard' :
                  f.title === 'AI Chatbot' ? '/chatbot' : '#'
                }
                className={
                  'group flex items-start gap-4 p-6 rounded-2xl shadow-lg border-2 transition-all hover:scale-105 focus:scale-105 ' +
                  (isDark
                    ? 'bg-[#183d2b] border-green-900 text-white hover:border-green-400'
                    : 'bg-white border-green-300 text-[#183d2b] hover:border-emerald-400')
                }
                style={{ textDecoration: 'none', minHeight: '140px' }}
              >
                <span className={
                  'text-4xl md:text-5xl drop-shadow-xl flex-shrink-0 ' +
                  (isDark ? 'text-green-300' : 'text-emerald-700')
                }>{f.icon}</span>
                <div>
                  <div className={
                    'text-xl md:text-2xl font-bold mb-1 ' +
                    (isDark ? 'text-green-100' : 'text-emerald-800')
                  }>{f.title}</div>
                  <div className={
                    'text-base md:text-lg ' +
                    (isDark ? 'text-green-200' : 'text-emerald-700')
                  }>{f.desc}</div>
                </div>
              </a>
            );
          })}
        </div>
      </section>
    </div>
  );
}

export default Home;
